import React from 'react';
import logo from './logo.svg';
import './App.css';
import axios from "axios";

class App extends React.Component {

  render(){
    return (
      <div className="App">
        <header className="App-header">
          componentDidMount() {
            axios.get("http://localhost:8000/api/todos/")
          }
        </header>
      </div>
    );
  }

}

export default App;
